import{_ as a,c as t,o as i,ag as s}from"./chunks/framework.Ds6Eueu6.js";const p=JSON.parse('{"title":"Additional Supplied Modules","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/modules/intro.md","filePath":"docs/7x/ref_guide/modules/intro.md"}'),r={name:"docs/7x/ref_guide/modules/intro.md"};function o(l,e,n,d,h,c){return i(),t("div",null,e[0]||(e[0]=[s('<h1 id="additional-supplied-modules" tabindex="-1">Additional Supplied Modules <a class="header-anchor" href="#additional-supplied-modules" aria-label="Permalink to &quot;Additional Supplied Modules&quot;">â€‹</a></h1><p>This section describes additional modules available in the WarehousePG installation. These modules may be PostgreSQL- or WarehousePG-sourced.</p><p><code>contrib</code> modules are typically packaged as extensions. You register a module in a database using the <a href="./../sql_commands/CREATE_EXTENSION.html">CREATE EXTENSION</a> command. You remove a module from a database with <a href="./../sql_commands/DROP_EXTENSION.html">DROP EXTENSION</a>.</p><p>The following WarehousePG and PostgreSQL <code>contrib</code> modules are installed; refer to the linked module documentation for usage instructions.</p><ul><li><a href="./adv_passwd_check.html">advanced_password_check</a> Provides password quality checking and policy definition for WarehousePG.</li><li><a href="./auto-explain.html">auto_explain</a> Provides a means for logging execution plans of slow statements automatically.</li><li><a href="./btree_gin.html">btree_gin</a> - Provides sample generalized inverted index (GIN) operator classes that implement B-tree equivalent behavior for certain data types.</li><li><a href="./citext.html">citext</a> - Provides a case-insensitive, multibyte-aware text data type.</li><li><a href="./dblink.html">dblink</a> - Provides connections to other WarehousePGs.</li><li><a href="./diskquota.html">diskquota.md#</a> - Allows administrators to set disk usage quotas for WarehousePG roles and schemas.</li><li><a href="./fuzzystrmatch.html">fuzzystrmatch</a> - Determines similarities and differences between strings.</li><li><a href="./gp_exttable_fdw.html">gp_exttable_fdw</a> - Built-in foreign-data wrapper that internally converts an external table to a foreign table.</li><li><a href="./gp_legacy_string_agg.html">gp_legacy_string_agg</a> - Implements a legacy, single-argument <code>string_agg()</code> aggregate function that was present in WarehousePG 5.</li><li><a href="./gp_sparse_vector.html">gp_sparse_vector</a> - Implements a WarehousePG data type that uses compressed storage of zeros to make vector computations on floating point numbers faster.</li><li><a href="./greenplum_fdw.html">greenplum_fdw</a> - Provides a foreign data wrapper (FDW) for accessing data stored in one or more external WarehousePG clusters.</li><li><a href="./hstore.html">hstore</a> - Provides a data type for storing sets of key/value pairs within a single PostgreSQL value.</li><li><a href="./ip4r.html">ip4r</a> - Provides data types for operations on IPv4 and IPv6 IP addresses.</li><li><a href="./ltree.html">ltree</a> - Provides data types for representing labels of data stored in a hierarchical tree-like structure.</li><li><a href="./orafce_ref.html">orafce</a> - Provides WarehousePG-specific Oracle SQL compatibility functions.</li><li><a href="./pageinspect.html">pageinspect</a> - Provides functions for low level inspection of the contents of database pages; available to superusers only.</li><li><a href="./pg_cron.html">pg_cron</a> - Provides a cron-based job scheduler that runs inside the database.</li><li><a href="./pg_trgm.html">pg_trgm</a> - Provides functions and operators for determining the similarity of alphanumeric text based on trigram matching. The module also provides index operator classes that support fast searching for similar strings.</li><li><a href="./pg_buffercache.html">pg_buffercache</a> - Provides access to five views for obtaining cluster-wide shared buffer metrics.</li><li><a href="./pgcrypto.html">pgcrypto</a> - Provides cryptographic functions for WarehousePG.</li><li><a href="./postgresml.html">postgresml</a> - Provides functions for using tens of thousands of pre-trained open source AI/machine learning models in WarehousePG.</li><li><a href="./pgvector/pgvector.html">pgvector</a> - Provides vector similarity search capabilities for WarehousePG that enable searching, storing, and querying machine language-generated embeddings at large scale.</li><li><a href="./postgres_fdw.html">postgres_fdw</a> - Provides a foreign data wrapper (FDW) for accessing data stored in an external PostgreSQL or WarehousePG.</li><li><a href="./postgresql-hll.html">postgresql-hll</a> - Provides HyperLogLog data types for PostgreSQL and WarehousePG.</li><li><a href="./sslinfo.html">sslinfo</a> - Provides information about the SSL certificate that the current client provided when connecting to WarehousePG.</li><li><a href="./tablefunc.html">tablefunc</a> - Provides various functions that return tables (multiple rows).</li><li><a href="./timestamp9.html">timestamp9</a> - Provides an efficient nanosecond-precision timestamp data type for WarehousePG.</li><li><a href="./tsm_system_rows.html">tsm_system_rows</a> - Implements the <code>SYSTEM_ROWS</code> table sampling method.</li><li><a href="./tsm_system_time.html">tsm_system_time</a> - implements the <code>SYSTEM_TIME</code> table sampling method.</li><li><a href="./uuid-ossp.html">uuid-ossp</a> - Provides functions to generate universally unique identifiers (UUIDs).</li></ul>',5)]))}const f=a(r,[["render",o]]);export{p as __pageData,f as default};
